const asynchronousFunction = async () =>  {
    const response = await fetch('/google-trend');
    const body = await response.json();
    const results = body.default.trendingSearchesDays[0];
    return results
}


export default function mainFunction (result) {
  result = asynchronousFunction()
  return result
}
